import React, { Component } from 'react'
import moduleName from 'nanoid'

import MessageCar from '../../../../../components/content/MessageCar'


export default class Studens extends Component {
  render() {
    const { studens } = this.props.classDetail
    return (
      <div className='class-detail-message'>
        {
          studens.map((studensobj) => {
            return <MessageCar key={nanoid()}  {...studensobj} ></MessageCar>
          })
        }

      </div>
    )
  }
}
